import Form from "../../form/Form";
import styles from "./AddSubject.module.css";

function AddSubject() {
  const dispatch = useDispatch();
  return (
    <div className={styles.container}>
      <Form btnName="Submit">AddSubject</Form>
    </div>
  );
}

export default AddSubject;
